INSERT INTO `catalog_pages` VALUES ('85585', '9999', 'DEFAULT', null, 'Comet Catalogue', '1', '2554', '1', '1', '1', '0', '1', 'recycler_info', '0', '0', '[\"<i><b><font color=\\\"#0E668C\\\" size=\\\"16\\\">What can I find in the shop?<\\/font><\\/b><\\/i><br><br>Upgrade your clothing with Habbo Club, adopt a pet or decorate your room the way you like it. Whatever you like to do most in Habbo, you\'ll find a way to make that experience even better by browsing our Shop.<br><br><li>Join <a href=\\\"event:catalog\\/open\\/habbo_club\\\">Habbo Club<\\/a><\\/li><li><a href=\\\"event:catalog\\/open\\/set_pixelnew\\\">Decorate <\\/a>your room<\\/li><li>Adopt a <a href=\\\"event:catalog\\/open\\/pet_horse\\\">Pet<\\/a>, <a href=\\\"event:catalog\\/open\\/bots\\\">Bot<\\/a> or <a href=\\\"event:catalog\\/open\\/monster_plants_info\\\">Monsterplants<\\/a><\\/li><li>Make your own <a href=\\\"event:catalog\\/open\\/category_wired\\\">Wired<\\/a> games <\\/li><li>Trade in our <a href=\\\"event:catalog\\/open\\/marketplace_offers\\\">Marketplace<\\/a><\\/li><br><i><b><font color=\\\"#0E668C\\\" size=\\\"16\\\">Where can I get credits?<\\/font><\\/b><\\/i><br><br>We have many methods of payment such as SMS, Home Phone, Prepaid Cards, and Credit Cards.<br><br><a href=\\\"event:habblet\\/open\\/credits\\\">Visit our credits page for more info.<\\/a>\",\"Reedem a voucher code here.\"]', '[\"catalog_frontpage_headline_shop_GENERAL\",\"frontpage_teaser\"]', 'undefined');
